import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

// Importez vos pages
import Home from "./pages/home/home";
import Signup from "./pages/signup/signup";
import User from "./pages/user/user";

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/signup">
            <Signup />
          </Route>
          <Route path="/user">
            <User />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
